import React, { Suspense, lazy } from 'react';
import { Eye, Brain, MessageCircle } from 'lucide-react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import LoadingSpinner from './LoadingSpinner'; // Create a simple spinner component

// Lazy load components for better performance
const FeatureCard = lazy(() => import('./FeatureCard'));

const HomePage = () => {
  return (
    <div className="min-h-screen bg-gray-50">
      {/* Hero Section */}
      <div 
        className="relative h-[600px] bg-gradient-to-r from-blue-900 to-indigo-900 overflow-hidden"
      >
        {/* Dynamic Background Animation */}
        <motion.div
          className="absolute inset-0 bg-gradient-to-r from-blue-800 to-indigo-800 opacity-50"
          initial={{ scale: 1.2 }}
          animate={{ scale: 1 }}
          transition={{ duration: 2, ease: 'easeInOut' }}
        />
        <div className="relative z-10 h-full flex flex-col items-center justify-center text-white px-4">
          <motion.h1
            className="text-5xl md:text-7xl font-bold mb-6 text-center"
            initial={{ opacity: 0, y: -50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1, delay: 0.5 }}
          >
            Advanced OCT Analysis
          </motion.h1>
          <motion.p
            className="text-xl md:text-2xl mb-12 text-center max-w-3xl"
            initial={{ opacity: 0, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1, delay: 1 }}
          >
            AI-Powered Retinal Disease Detection
          </motion.p>
          <motion.div
            className="flex flex-wrap gap-6 justify-center"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 1, delay: 1.5 }}
          >
            <Link
              to="/classify"
              className="bg-blue-600 hover:bg-blue-700 text-white px-8 py-3 rounded-lg flex items-center text-lg transition-all duration-300 ease-in-out transform hover:scale-105 hover:shadow-lg"
              aria-label="Start Analysis"
            >
              <Eye className="mr-2" /> Start Analysis
            </Link>
          </motion.div>
        </div>
      </div>

      {/* Features Section */}
      <div className="py-20 px-4 bg-white">
        <div className="max-w-6xl mx-auto">
          <motion.h2
            className="text-4xl font-bold text-center mb-12"
            initial={{ opacity: 0, y: -20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 1 }}
            viewport={{ once: true }}
          >
            Our Technology
          </motion.h2>
          <div className="grid md:grid-cols-3 gap-8">
            <Suspense fallback={<LoadingSpinner />}>
              <FeatureCard
                icon={<Brain className="w-12 h-12 text-blue-600" />}
                title="AI Detection"
                description="State-of-the-art deep learning for accurate diagnosis"
              />
              <FeatureCard
                icon={<Eye className="w-12 h-12 text-blue-600" />}
                title="Multiple Models"
                description="Support for various architectures including MobileNet, ResNet, and EfficientNet"
              />
              <FeatureCard
                icon={<MessageCircle className="w-12 h-12 text-blue-600" />}
                title="Interactive Chat"
                description="Get instant answers about conditions and treatments"
              />
            </Suspense>
          </div>
        </div>
      </div>

      {/* Contact Section */}
      <div className="py-10 bg-gray-100">
        <div className="max-w-4xl mx-auto text-center">
          <motion.h3
            className="text-2xl font-bold mb-4"
            initial={{ opacity: 0, y: -20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 1 }}
            viewport={{ once: true }}
          >
            Contact Us
          </motion.h3>
          <p className="text-gray-700">
            Email: <a href="mailto:indraneelkalva@gmail.com" className="text-blue-600 hover:underline">indraneelkalva@gmail.com</a>
          </p>
          <p className="text-gray-700 mt-2">Phone: 7730841030</p>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
